import React from 'react'

export const Checkbox = (options) => {


  return (
    <div>
      {options.options.map(option => ( 
        <label key={option}>
          {option}
          <input 
          type="checkbox"

          />
        </label>
      ))}

  </div>
  )
}

export default Checkbox
